import React from "react";
import "./LandingPage.css";
import { useNavigate } from "react-router-dom";

const LandingPage = () => {
  const navigate = useNavigate();
  const handleGetStarted = () => {
    navigate("/register");
  };
  return (
    <div className="landing-container">
      {/* Navbar */}
      <nav className="navbar">
        {/* Left links */}
        <ul className="nav-left">
          <div className="logo">Advanced To Do</div>
          <li className="active">HOME</li>
          <li>DASHBOARD</li>
          <li>USERS</li>
          <li>TASKS</li>
        </ul>

        {/* Right buttons */}
        <div className="nav-right">
          <button className="loginn-btn" onClick={handleLoginOn}>LOGIN</button>
          <button className="signup-btn">SIGNUP</button>
        </div>
      </nav>

      {/* Hero Section */}
      <section className="hero-section">
        {/* Left Side - Content */}
        <div className="hero-left">
          <h1>
            stay organized, <br /> stay focused, <br /> achieve your goals effortlessly!
          </h1>
          <p>
            <b>
              Manage tasks, set deadlines,
              <br />
              and get smart reminders â€” making productivity simple and effective!
            </b>
          </p>
          <button className="dashboard-btn" onClick={handleGetStarted}>Get Started Now </button>
        </div>

        {/* Right Side - Image */}
        <div className="hero-right">
          <img
            src="https://images.unsplash.com/photo-1484480974693-6ca0a78fb36b?w=500&auto=format&fit=crop&q=60&ixlib=rb-4.1.0&ixid=M3wxMjA3fDB8MHxzZWFyY2h8M3x8dG8lMjBkbyUyMGxpc3R8ZW58MHx8MHx8fDA%3D"
            alt="To Do List"
          />
        </div>
      </section>

         {/* Features Section */}
      <section className="features-section">
        <div className="feature-card">
          <h3>Manage user</h3>
          <p>Easily manage your user records, track details, and maintain an up-to-date roster.</p>
          <button>VIEW USERS</button>
        </div>
        <div className="feature-card">
          <h3>Track Task</h3>
          <p>Organize your company's structure with detailed information on each task.</p>
          <button>VIEW TASK</button>
        </div>
        <div className="feature-card">
          <h3>Analyze Growth</h3>
          <p>Use our comprehensive dashboard to analyze employee growth and organizational structure.</p>
          <button>GO TO DASHBOARD</button>
        </div>
      </section> 
    </div>
    
    
  );
};

export default LandingPage;
